import React from "react";

const DropDown = ({ selectChange, robots }) => {
    return (
        <div>
            <select className="pa3 ba b--green bg-lightest-blue" onChange={selectChange} >
                <div>
                    {
                        robots.map((user, i) => {
                            return (
                                <option>{robots[i].name}</option>
                            )
                        })
                    }
                </div>
            </select>
        </div>
    );
}

export default DropDown;
